import { Navigate, Outlet } from "react-router-dom";

const PrivateRoute = ({ user }) => {
  const styles = {
    padding: "6rem 0 0 26rem",
    backgroundColor: "#181818",
    color: "#ffffff",
    minHeight: "calc(100vh - 6rem)",
  };

  return user ? (
    <div style={styles}>
      <Outlet />
    </div>
  ) : (
    <Navigate to="/login" replace />
  );
};

export default PrivateRoute;
